import Button from "react-bootstrap/Button";

import "./Dashboard.css";
import { useDispatch, useSelector } from "react-redux";
import { deletePro } from "../../rtk/slices/productsSlice";
import { Link } from "react-router-dom";
import Table from "react-bootstrap/Table";
import Card from "react-bootstrap/Card";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
const ProductsTable = () => {
  const { products } = useSelector((state) => state.products);
  const dispatch = useDispatch();
  // const [filterVal, setFilter] = useState("");

  // const productsFilter = () => {
  //   const e = products.filter((e) => e.productName.includes(filterVal));
  //   return e;
  // };
  return (
    <Row>
      {products.map((product) => (
        <Col className=" col-md-3 p-2" key={product.id}>
          <Card className="col-style ">
            <Col md={3}>
              <Card.Img variant="top" src={product.img} />
            </Col>
            <Col>
              <Card.Body>
                <Card.Title>{product.productName}</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Col>
          </Card>
        </Col>
      ))}
    </Row>
  );
};

export default ProductsTable;
